import React, {Component} from "react";
import login from "./login.png";
import './Profile.css';

class Profile extends Component {

    render() {
        return (
            <div>
                <div className="jumbotron"  className="profile" style={{paddingLeft:"5%",width:"100%",height:"200px"}} >
                    <img src={login} alt="login icon" className="login-icon" />
                    <p>Name: LEENA</p>
                    <p>Email:leena@nineleaps.com</p>
                    <p>Contact:9880754321</p>


                </div>
                <br />
            </div>
        )
    }
}

export default Profile;
